import React from 'react'

const Navigation = ({onRoutChange}) =>{

        if(isSignedIn){
            return(
                <nav style={{display:'flex', justifyContent:'flex-end'}} >
                    <p onClick={()=>onRoutChange('signin')} className='f3 link dim black underline pa3 pointer'>Sign Out</p>
                </nav>
            )
           
        }
        else{
            return(
                <div>
                    <nav style={{display:'flex', justifyContent:'flex-end'}} >
                        <p onClick={()=>onRoutChange('signin')} className='f3 link dim black underline pa3 pointer'>Sign In</p>
                    </nav>
                    <nav style={{display:'flex', justifyContent:'flex-end'}} >
                        <p onClick={()=>onRoutChange('signin')} className='f3 link dim black underline pa3 pointer'>Register</p>
                    </nav>
                </div>
            )
            
        }
    
}

export default Navigation
